values:
Im done trying. I don't have the time, patience, or room in my life for this.&nbsp;
I tried.&nbsp;
Im tired.
Thats all there is to it.&nbsp;
I have so much crap going on that I've become broken.&nbsp;
I want to break up with my boyfriend.&nbsp;
Not because Im not happy with him&nbsp;but Im not happy with myself and that just seems to radiate off of me.&nbsp;
I can't go a day with out&nbsp;biting someones head off.&nbsp;
Its not that I&nbsp;want to, because I don't mean to it just&nbsp;happens.&nbsp;
I work way too much yet thats not enough.
I need money.&nbsp;
Im sorry Im younger than you and a supervisor.&nbsp;
Get over it.&nbsp;
Don't act childish.&nbsp;
Don't tell me you don't have to listen to me.&nbsp;
Last time I checked, I ask nicely and when people say no I tell them to do it.&nbsp;
And thats rare.&nbsp;
Hours being cut back due to sports.

Tracks starting thats gonna interfere but its my last year and even though i suck at it,&nbsp;it makes me happy.&nbsp;
College is coming up really fast.&nbsp;
Have about a month and a half to decide where I want to go.&nbsp;
Do I want to stay close to home or move in with my dad over the summer and go to a&nbsp;Virginia school.&nbsp;
Do&nbsp;I want to attempt to stay with Sam even if we go far apart.&nbsp;


WHAT THE FUCK DO I WANT!!!!

Can someone please just tell me.&nbsp;
I have noone to talk to.&nbsp;
And it feels shitty.&nbsp;
I have no friends to go to.&nbsp;
I've lost touch.&nbsp;
And you know what.&nbsp;
Thats the shittiest part.&nbsp;

Its shitty that I get to the&nbsp;point where I just get to the point that I break down and cry at work because a mistake was made.&nbsp;
That was all that it took to push me over the edge.&nbsp;
Its shitty that I was so close to breaking up with sam and told him.&nbsp;
I saw the hurt in his eyes and I can't explain&nbsp;enough that its not him.&nbsp;
Its me.&nbsp;
Its me and I can't stop these feelings.&nbsp;

I want to reconnect with my friends.&nbsp;
I do.&nbsp;
I guess I dont deserve that though.
&nbsp;

Fuck I want change.&nbsp;

I want to be the person I use to be.&nbsp;
I want to hang out with my friends.&nbsp;
I've pretty much forgotten what thats like.&nbsp;
The only one I ever see is Ashley and thats so rare.&nbsp;

Im always working or with Sam.&nbsp;
I want to break away from that.&nbsp;
The other day I needed someone to call and talk to and I realized who the hell was I going to call??
Schools more than half way over and I just want to be happy.
Happy is something Im not right now.&nbsp;

Ive gotten the worse report card of my life and it blows.&nbsp;

I need some fun and I have a lot of stuff to make up to people.&nbsp;

&nbsp;Please Please Please let things work out.&nbsp;

The last two weeks have just been shitty.&nbsp;
Sam broke up with me yesterday.&nbsp;
I think.&nbsp;
I mean he did but we are still in a relationship.&nbsp;
NO anything with other people.&nbsp;
And we can still hangout we just aren't boyfriend and girlfriend right now??
Im not really sure myself.&nbsp;
All I know is I don't like how things are.&nbsp;
It hurts A LOT!
Last night I kept having these messed up dreams and I couldn't sleep which made me hurt and miss him more.&nbsp;
I tried calling this morning.&nbsp;
Probably shouldn't have.&nbsp;
We are working on space.
I want to say a lot of things to him but I dont have the guts.&nbsp;
All I can think of is how much I miss him.&nbsp;
Every stupid song I listen to reminds me of him.&nbsp;
Im glad my iPod broke because then I don't have to listen to the Beatles.&nbsp;
I want things better.&nbsp;
I want them back to normal.&nbsp;
I knew we shouldn't have hung out every single day, Dan warned me.&nbsp;
I guess all I can do is wait for a phone call.&nbsp;
I love him. I really do.&nbsp;



Love, love, love, love, love, love, love, love, love.
There's nothing you can do that can't be done.
Nothing you can sing that can't be sung.
Nothing you can say but you can learn how to play the game
It's easy.
There's nothing you can make that can't be made.
No one you can save that can't be saved.
Nothing you can do but you can learn how to be in time
It's easy.
All you need is love, all you need is love,
All you need is love, love, love is all you need.
Love, love, love, love, love, love, love, love, love.
All you need is love, all you need is love,
All you need is love, love, love is all you need.
There's nothing you can know that isn't known.
Nothing you can see that isn't shown.
Nowhere you can be that isn't where you're meant to be.
It's easy.
All you need is love, all you need is love,
All you need is love, love, love is all you need.
All you need is love (all together now)
All you need is love (everybody)
All you need is love, love, love is all you need.

1. List twenty things you wish you could say to people but can't. You can list the same people repeatidly.
2. Don't say who they are.
3. Never discuss it again


One. I miss you.&nbsp;
Two.&nbsp;Im glad things didn't work out with you this summer.&nbsp;You are a lying asshole who likes fat chicks and ex-lesbians. No offense against her though.&nbsp;
Three.I love you.&nbsp;
Four.Being friends was the better decision.&nbsp;
Five.I miss you and Chester.&nbsp;
Six.I lied.
Seven.Let him go.&nbsp;
Eight.I wish I&nbsp;hadn't walked away.&nbsp;
Nine.You are a shitty parent.&nbsp;
Ten.Thank you.&nbsp;
Eleven.You are probably the greatest thing to ever happen to me and I won't ever have the balls to say it to you.&nbsp;
Twelve.I think dropping out of school is a lame plan. (yes you) but if it makes you&nbsp; happy.&nbsp;
Thirteen.Je te veut.
Fourteen.I can't do this anymore.&nbsp;
Fifteen.You are GAY.
Sixteen-Twenty. Fuck OFF!
